import {AlbumContext} from '../App'

function Album() {

    const albums=useContext(AlbumContext);
    console.log(albums);
    return (
        <>

            albums.map(album=>(
                <div className='AlbumCard'>
                <div className='ImageCard'>
                    <img src='unkownAlbum.png'/>
                </div>            
                <h5 className='AlbumTitle'>{album.title}</h5>
            </div>
                ))



        <p>Hello from Albums</p>
        </>


    )
}

export default Album
